import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="portada">
        <h1 className="titulo">Snacks Kary</h1>
        <p className="descripcion">Contamos con excelente servicio y calidad en nuestros productos.</p>
      </div>
      </header>
    </div>
  );
}

export default App;
